    <h1>Access OnDemand Loop</h1>
    <p>To use the OnDemand Loop application within the FASRC HPC cluster you must have an active FASRC account.</p>
    <p>Please ensure you are connected to the VPN before continuing.</p>
    <a id="continue" class="btn-primary" href="#">Continue to OnDemand Loop</a>

  <script>

    const env = params.get('env') || 'local';
    const base = loop_urls[env] || loop_urls['local'];
    const query = params.toString();
    document.getElementById('continue').href = base + (query ? (base.includes('?') ? '&' : '?') + query : '');
